pragma solidity ^0.4.25;

contract MockKittyContract {
    struct Kitty {
        uint256 genes;
        uint64 birthTime;
        uint32 matronId;
        uint32 sireId;
        uint16 generation;
    }

    mapping(uint256 => Kitty) public kitties;
    uint256 public nextKittyId;

    function createKitty(uint256 _genes) public {
        kitties[nextKittyId] = Kitty({
            genes: _genes,
            birthTime: uint64(block.timestamp),
            matronId: 0,
            sireId: 0,
            generation: 0
        });

        nextKittyId++;
    }

    // Function to retrieve details of a kitty
    function getKitty(uint256 _tokenId)
        external
        view
        returns (
            bool isGestating,
            bool isReady,
            uint256 cooldownIndex,
            uint256 nextActionAt,
            uint256 siringWithId,
            uint256 birthTime,
            uint256 matronId,
            uint256 sireId,
            uint256 generation,
            uint256 genes
        )
    {
        Kitty memory kitty = kitties[_tokenId];
        return (
            false, 
            true, 
            0,    
            0,    
            0, 
            kitty.birthTime,
            kitty.matronId,
            kitty.sireId,
            kitty.generation,
            kitty.genes
        );
    }
}
